void CoolspotFont::CopyLetter(unsigned char c, int line, int* buffer)
{
   unsigned int char_offset = (unsigned char)c;
   if (char_offset >= 0xFF) char_offset = 0xFE;

   int offset = char_position_[char_offset] + (/*coolspot_font.bytes_per_pixel * */line * coolspot_font.width);//coolspot_font.bytes_per_pixel;
   int endoffset = char_position_[char_offset +1]-1 + (/*coolspot_font.bytes_per_pixel * */ line * coolspot_font.width);

   if ( offset >0 && endoffset > 0)
   {
      unsigned int* col_buffer = (unsigned int*)buffer;
      for (offset; offset< endoffset ; offset++)
      {
         if (coolspot_font.pixel_data[offset] != 0)
         {
            *col_buffer = coolspot_font.pixel_data[offset];
         }
         col_buffer++;
      }
   }
}


void CoolspotFont::CopyLetter(unsigned char c, int* buffer, int stride)
{
   unsigned int char_offset = (unsigned char)c;
   if (char_offset >= 0xFF) char_offset = 0xFE;

   int offset = char_position_[char_offset];
   int endoffset = char_position_[char_offset + 1] - 1;

   if (offset > 0 && endoffset > 0)
   {
      const unsigned int* end = &coolspot_font.pixel_data[endoffset];
      for (int y = 0; y < coolspot_font.height; y++)
      {
         int* col_buffer = (int*)(&((unsigned char*)buffer)[y * stride]);
         const unsigned int* begin = &coolspot_font.pixel_data[offset] + y * coolspot_font.width;
         for (;begin < end; begin++)
         {
            if (*begin != 0)
            {
               *col_buffer = *begin | 0xFF000000;
            }
            col_buffer++;
         }
         end += coolspot_font.width;
      }
   }
}

int CoolspotFont::GetLetterLength(unsigned char c)
{
   if (c < 0xFF)
   {
      return (char_position_[c + 1] - (char_position_[c])) - 1;
   }
   else
   {
      return (coolspot_font.width * coolspot_font.bytes_per_pixel - (char_position_[c]))- 1;
   }
   
}

int CoolspotFont::GetLetterHeight(unsigned char c)
{
   return coolspot_font.height;
}

